import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Header from "./components/global/Header";
import Footer from "./components/global/Footer";
import HomePage from "./pages/HomePage";
import AboutPage from "./pages/AboutPage";
import SingInPage from "./pages/SingInPage";
import SignUpPage from "./pages/SignUpPage";
import PasswordForgottenPage from "./pages/PasswordForgottenPage";
import ReservationPage from "./pages/ReservationPage";
import PasswordNewPage from "./pages/PasswordNewPage";
import ReservationConfirmationPage from "./pages/ReservationConfirmationPage";
import AccountPage from "./pages/AccountPage";
import AccountEditPage from "./pages/AccountEditPage";
import ReservationListPage from "./pages/ReservationListPage";
import ReservationEditPage from "./pages/ReservationEditPage";

import "./App.css";

function App() {
	return (
		<Router>
			<div className='App'>
				<Routes>
					<Route path='/' element={<HomePage />} />
					<Route path='/about' element={<AboutPage />} />
					<Route path='/SingInPage' element={<SingInPage />} />
					<Route path='/SignUpPage' element={<SignUpPage />} />
					<Route path='/PasswordForgottenPage' element={<PasswordForgottenPage />} />
					<Route path='/ReservationPage' element={<ReservationPage />} />
					<Route path='/PasswordNewPage' element={<PasswordNewPage />} />
					<Route path='/ReservationConfirmationPage' element={<ReservationConfirmationPage />} />
					<Route path='/AccountPage' element={<AccountPage />} />
					<Route path='/AccountEditPage' element={<AccountEditPage />} />
					<Route path='/ReservationListPage' element={<ReservationListPage />} />
					<Route path='/ReservationEditPage' element={<ReservationEditPage />} />
				</Routes>
			</div>
		</Router>
	);
}

export default App;
